import React from 'react';
import '../index.css';
import headerImage from '../media/header-image.jpg';


const openSide = () => {
    document.getElementById('side--menu').style.width = "70%";
    document.getElementById('header').style.marginLeft = "70%";
    document.getElementById('main').style.marginLeft = "70%";
};

const Header = () => {
    return (
        <header id="header">
            <div className='header'>
                <div className='header--title'>
                    <h1>TOR SOLAETXE</h1>
                </div>
                <div className='header--subtitle'>
                    <h2>-----------------          Astrology          -----------------</h2>
                </div> 
                <img src={headerImage} alt=''></img>
            </div>
            <div id='side--menu-button'>
                <button className='side--menu-button' onClick={openSide}>&#9776;</button>
            </div>
        </header>
    )
}

export default Header
